import React from "react";
import { Text, View, StyleSheet } from "react-native";

function MenuBarItem(props) {
  return (
    <View>
      <Text>{props.title}</Text>
    </View>
  );
}

const styles = StyleSheet.create({});

export default MenuBarItem;
